import React from 'react'
import { NavLink } from 'react-router-dom';
import About from '../../pages/About';


import Home from '../Home/home'
import "./Navbar.css"

const Navbar = () => {
  return (
    <nav>
      {/*Logo*/}
      <a href="#" class="logo">Resume</a>
      {/*Menu*/}
      <ul>
        <li><NavLink to="/">Home</NavLink></li>
        <li><NavLink to="/About/About">About</NavLink></li>
        <li><a href="portfolio1.html">Services</a></li>
        <li><a href="portfolio1.html">Blog</a></li>
        <li><a href="portfolio1.html">Portfolio</a></li>
        <li><a href="resume.html">Resume</a></li>
        <li><a href="contact.html">Contact</a></li>
      </ul>
      <img src='././assets/menu.png' className='menu'></img>
    </nav>
  )
}

export default Navbar
